import * as React from "react";
import Checkbox from "@mui/material/Checkbox";

export default function Test() {
  return (
    <div style={{ margin: "25%" }}>
      <Checkbox />
      <Checkbox disabled />
      <Checkbox disabled checked />
    </div>
  );
}
